import React, { useState } from "react";
import axios from "axios";

const Login = ({ onLogin, onSwitchToRegister }) => {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
  });
  const [isLoading, setIsLoading] = useState(false);
  const [errors, setErrors] = useState({});
  const [showPassword, setShowPassword] = useState(false);
  const [rememberMe, setRememberMe] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));

    // Clear error when user starts typing
    if (errors[name]) {
      setErrors((prev) => ({
        ...prev,
        [name]: "",
      }));
    }
  };

  const validateForm = () => {
    const newErrors = {};

    if (!formData.email) {
      newErrors.email = "Email is required";
    } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
      newErrors.email = "Please enter a valid email address";
    }

    if (!formData.password) {
      newErrors.password = "Password is required";
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!validateForm()) {
      return;
    }

    setIsLoading(true);

    try {
      const response = await axios.post("/api/auth/login", {
        email: formData.email.toLowerCase().trim(),
        password: formData.password,
      });

      if (response.data.success) {
        // Store token in localStorage
        localStorage.setItem("authToken", response.data.token);
        localStorage.setItem("user", JSON.stringify(response.data.user));

        // Store in sessionStorage if not remembering
        if (!rememberMe) {
          sessionStorage.setItem("authToken", response.data.token);
          sessionStorage.setItem("user", JSON.stringify(response.data.user));
          localStorage.removeItem("authToken");
          localStorage.removeItem("user");
        }

        onLogin(response.data.user, response.data.token);
      }
    } catch (error) {
      console.error("Login error:", error);

      if (error.response?.data?.errors) {
        // Handle validation errors
        const validationErrors = {};
        error.response.data.errors.forEach((err) => {
          validationErrors[err.field] = err.message;
        });
        setErrors(validationErrors);
      } else {
        setErrors({
          general:
            error.response?.data?.message || "Login failed. Please try again.",
        });
      }
    } finally {
      setIsLoading(false);
    }
  };

  const handleDemoLogin = async () => {
    setFormData({
      email: "demo@expensetracker.com",
      password: "Demo123!",
    });

    setIsLoading(true);

    try {
      const response = await axios.post("/api/auth/login", {
        email: "demo@expensetracker.com",
        password: "Demo123!",
      });

      if (response.data.success) {
        localStorage.setItem("authToken", response.data.token);
        localStorage.setItem("user", JSON.stringify(response.data.user));
        onLogin(response.data.user, response.data.token);
      }
    } catch (error) {
      // If demo account doesn't exist, create it
      try {
        await axios.post("/api/auth/register", {
          name: "Demo User",
          email: "demo@expensetracker.com",
          password: "Demo123!",
          confirmPassword: "Demo123!",
          currency: "USD",
        });

        // Now login with the created account
        const loginResponse = await axios.post("/api/auth/login", {
          email: "demo@expensetracker.com",
          password: "Demo123!",
        });

        if (loginResponse.data.success) {
          localStorage.setItem("authToken", loginResponse.data.token);
          localStorage.setItem("user", JSON.stringify(loginResponse.data.user));
          onLogin(loginResponse.data.user, loginResponse.data.token);
        }
      } catch (createError) {
        setErrors({
          general: "Demo account setup failed. Please try manual registration.",
        });
      }
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <h1>âš¡ Expense Tracker</h1>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <input
              type="email"
              placeholder="Email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          <div className="form-group">
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>
          <button type="submit" disabled={loading}>
            {loading ? "Logging in..." : "Login"}
          </button>
        </form>
        <p className="demo-info">Demo: test@test.com / test123</p>
      </div>
    </div>
  );
};

export default Login;
